import React from 'react';
import { destinations } from './data';
import DatePicker from 'react-datepicker';
import "react-datepicker/dist/react-datepicker.css";

class MyPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      destination: null,
      username: '',
      description: '',
      duration: 0,
      date: new Date(),
      users: []
    };
    this.onChangeUsername = this.onChangeUsername.bind(this);
    this.onChangeDescription = this.onChangeDescription.bind(this);
    this.onChangeDuration = this.onChangeDuration.bind(this);
    this.onChangeDate = this.onChangeDate.bind(this);
    this.onSubmit = this.onSubmit.bind(this);
  }

  componentDidMount() {
    const id = this.props.match.params.id;
    const destinationId = id.split('/').pop();
    const destination = destinations.find((d) => d.id === parseInt(destinationId));
    this.setState({ destination });

  //   axios.get('http://localhost:5000/users/')
  //     .then(response => {
  //       if (response.data.length > 0) {
  //         this.setState({
  //           users: response.data.map(user => user.username),
  //         })
  //       }
  //     })
  //     .catch((error) => {
  //       console.log(error);
  //     })
   }

  onChangeUsername(e) {
    this.setState({
      username: e.target.value
    })
  }

  onChangeDescription(e) {
    this.setState({
      description: e.target.value
    })
  }

  onChangeDuration(e) {
    this.setState({
      duration: e.target.value
    })
  }

  onChangeDate(date) {
    this.setState({
      date: date
    })
  }

  onSubmit(e) {
    e.preventDefault();

    const exercise = {
      username: this.state.username,
      description: this.state.description,
      duration: this.state.duration,
      date: this.state.date
    }

    console.log(exercise);

    axios.post('http://localhost:5000/exercises/update/' + this.props.match.params.id, exercise)
      .then(res => console.log(res.data));

    window.location = '/';
  }

  render() {
    const { destination } = this.state;

    if (!destination) {
      return <div>Loading...</div>;
    }

    return (
      <div className="destination">
        <img src={destination.image} alt={destination.name} />
        <div className="destination-info">
          <h3>{destination.name}</h3>
          <p>{destination.description}</p>
          <p>Continent: {destination.continent}</p>
          <p>Climate: {destination.climate}</p>
          <p>Best Time to Visit: {destination.bestTimeToVisit}</p>
          <p>Language: {destination.language}</p>
          <p>Currency: {destination.currency}</p>
          <form onSubmit={this.onSubmit}>
            <div className="form-group">
              <label>Username: </label>
              <select
                required
                className="form-control"
                value={this.state.username}
                onChange={this.onChangeUsername}>
                {
                  this.state.users.map(function(user) {
                    return <option
                      key={user}
                      value={user}>{user}
                    </option>;
                  })
                }
              </select>
            </div>
            <div className="form-group">
              <label>Description: </label>
              <input type="text"
                required
                className="form-control"
                value={this.state.description}
                onChange={this.onChangeDescription}
              />
            </div>
            <div className="form-group">
              <label>Duration (in minutes): </label>
              <input
                type="text"
                className="form-control"
                value={this.state.duration}
                onChange={this.onChangeDuration}
              />
            </div>
            <div className="form-group">
              <label>Date: </label>
              <div>
                <DatePicker
                  selected={this.state.date}
                  onChange={this.onChangeDate}
                />
              </div>
            </div>
            <div className="form-group">
              <input type="submit" value="Update Exercise Log" className="btn btn-primary" />
            </div>
          </form>
        </div>
      </div>
    );
  }
}

export default MyPage;
